SCFVFactory::SCFVFactory(const Parameters & params):m_bHasVar(false), m_fSCFVThreshold(0.0f), mygmm(SCFVSignature::numberCentroids, SCFVSignature::PCASiftLength) {
    mygmm.load(GMM_W, GMM_MU, GMM_SIGMA);
    m_bHasVar           = params.hasVar;
    m_fSCFVThreshold    = params.scfvThreshold;
}

// generateSFV: reimplemented for portability using Eigen and the gmm-fisher lib
unsigned int SCFVFactory::generateSFV(const FeatureList& featureList, float* pFisherVector, bool vWordVisited[]) {
    /* 128-d SIFT descriptor projection */
    int nNumFeatures = (featureList.NumExtracted() >= SCFV_MAX_NUMBER_FEATURES)? SCFV_MAX_NUMBER_FEATURES : featureList.NumExtracted();
    int m = UNCOMPRESSED_SIFT_DESC_LENGTH;
    Matrix<float,UNCOMPRESSED_SIFT_DESC_LENGTH,Dynamic> DataPoints(m, nNumFeatures);  // matrix

    for (int nFeature = 0; nFeature < nNumFeatures; ++nFeature) {
        for(int nDim = 0; nDim < UNCOMPRESSED_SIFT_DESC_LENGTH; ++nDim)
            DataPoints(nDim, nFeature) = featureList.features[nFeature].descr[nDim];
    }

    // preprocess
    DataPoints =  DataPoints.array().pow(PCA_SIFT_POWER_LAW).matrix();
    // normalize all points
    for (int i = 0; i < DataPoints.cols(); i++){
        DataPoints.col(i).normalize();
    }

    // use mu as a VectorXf object
    Map<VectorXf> meanVector((float *) PCA_SIFT_MU, UNCOMPRESSED_SIFT_DESC_LENGTH);

    // for each point center the point with the mean among all the coordinates
    for (int i = 0; i < DataPoints.cols(); i++){
        DataPoints.col(i) -= meanVector;
    }

    // use eigvec as a MatrixXf object
    Map<MatrixXf> eigvectors((float *) PCA_SIFT_EIGEN, UNCOMPRESSED_SIFT_DESC_LENGTH, SCFVSignature::PCASiftLength);
    MatrixXf projected = eigvectors.transpose() * DataPoints;

    fisher_param myparams;
    myparams.grad_variances = m_bHasVar;
    myparams.alpha = SCFV_POWER_LAW;

    // myparams.print();

    fisher myfisher(myparams);
    myfisher.set_model(mygmm);

    float * myprojected = projected.data();
    size_t ncols = projected.cols();
    vector<float *> proj_vec(ncols, NULL);
    int nrows = projected.rows();
    for (int i=0; i<projected.cols(); ++i) {
        proj_vec[i] = myprojected + i*nrows;
    }

    myfisher.compute( proj_vec, pFisherVector );

    /* fv sparsity for scalable compact descriptor */
    unsigned int nNumWordsVisited = 0;
    if ((int) m_fSCFVThreshold > 1) {
        // use variance to reject gmm words
        map<float, int> stds;
        for (int nCentroid = 0; nCentroid < SCFVSignature::numberCentroids; nCentroid++) {
            float* pGmm = pFisherVector + nCentroid*SCFVSignature::PCASiftLength;
            float totalMean=0.0, totalStd=0.0;
            for (int nInDim = 0; nInDim < SCFVSignature::PCASiftLength; nInDim++)
                totalMean += pGmm[nInDim];
            totalMean /= SCFVSignature::PCASiftLength;
            for (int nInDim = 0; nInDim < SCFVSignature::PCASiftLength; nInDim++)
                totalStd += (pGmm[nInDim]-totalMean)*(pGmm[nInDim]-totalMean);
            totalStd = sqrt(totalStd / SCFVSignature::PCASiftLength);
            stds.insert(pair<float, int>(abs(totalStd), nCentroid));
        }

        // mark visits
        map<float, int>::reverse_iterator rit;
        for (rit=stds.rbegin(); rit!=stds.rend(); rit++) {
            if (nNumWordsVisited >= (int)m_fSCFVThreshold)
                break;
            vWordVisited[rit->second] = true;
            nNumWordsVisited++;
        }
    } else {
        // use max posterior probability pooling to reject gmm words
        float *p = new float [nNumFeatures * SCFVSignature::numberCentroids];
        // build p
        for (int i=0; i<projected.cols(); ++i) {
            mygmm.posterior( proj_vec[i], p + i*SCFVSignature::numberCentroids );
        }

        // use max posterior probability pooling to reject gmm words
        float *maxp = new float [SCFVSignature::numberCentroids];
        for (int k=0; k<SCFVSignature::numberCentroids; k++)
            maxp[k] = 0.0f;

        for (int j=0; j<nNumFeatures; j++) {
            for (int k=0; k<SCFVSignature::numberCentroids; k++) {
                if (p[j*SCFVSignature::numberCentroids+k] > maxp[k])
                    maxp[k] = p[j*SCFVSignature::numberCentroids+k];
            }
        }
        // mark visits
        for (int k=0; k<SCFVSignature::numberCentroids; k++) {
            vWordVisited[k] = (maxp[k] >= m_fSCFVThreshold);
            if (vWordVisited[k]) nNumWordsVisited++;
        }
        delete [] maxp;
        delete [] p;
    }

    return nNumWordsVisited;
}

void SCFVFactory::generateSCFV(const FeatureList& featureList, SCFVSignature & signature) {
    float* pFisherVector = new float[signature.size()];
    bool visited[SCFVSignature::numberCentroids];		// temporary array
    memset(visited, 0, sizeof(visited));				// clear all values in visited

    generateSFV(featureList, pFisherVector, visited);// Generate uncompressed SFV signature

    // Sign binarize
    for (int nCentroid = 0; nCentroid < SCFVSignature::numberCentroids; nCentroid++) {
        if (visited[nCentroid]) {
            unsigned int nPackedBlock = 0;
            float* pGmm = pFisherVector + nCentroid*SCFVSignature::PCASiftLength; // assumes SIFT PCA dimension <= block width = #bits(uint)
            for (int nDim = 0; nDim < SCFVSignature::PCASiftLength; nDim++) {
                unsigned int nBit = (pGmm[nDim] > 0) ? 1 : 0;
                PUSH_BIT(nPackedBlock, nBit);
            } // nDim
            signature.m_vWordBlock[nCentroid] = nPackedBlock;
        }
    } // nCentroid

    if (m_bHasVar) {
        for (int nCentroid = 0; nCentroid < SCFVSignature::numberCentroids; nCentroid++) {
            if (visited[nCentroid]) {
                unsigned int nPackedBlock = 0;
                float* pGmm = pFisherVector + (nCentroid+SCFVSignature::numberCentroids)*SCFVSignature::PCASiftLength; // assumes SIFT PCA dimension <= block width = #bits(uint)
                for (int nDim = 0; nDim < SCFVSignature::PCASiftLength; nDim++) {
                    unsigned int nBit = (pGmm[nDim] > 0) ? 1 : 0;
                    PUSH_BIT(nPackedBlock, nBit);
                } // nDim
                signature.m_vWordVarBlock[nCentroid] = nPackedBlock;
            }
        } // nCentroid
    }
    signature.setNorm();				// compute the norm of this signature
    delete [] pFisherVector;
}
